def getDayOfWeek(date): 
    day = date.day() 
    if day == 6:
        return "Sunday"
    elif day == 5:
        return "Monday"
    elif day == 4:
        return "Tuesday"
    elif day == 3:
        return "Wednesday"
    elif day == 2:
        return "Thursday"
    elif day == 1:
        return "Friday" 
    else:
        return "Saturday"

